import React from 'react'
import { useQuery } from 'react-query'

const Dummy = () => {

    const mobilecatalogue = useQuery('mobilecatalogue', async () => {
        const response = await fetch('https://pcat.mobile.xfinity.com/product/details');
        return response.json();
    });

    if(mobilecatalogue.isLoading){
        return <h1>Loading...</h1>
      }

    const phone = mobilecatalogue.data
    console.log(phone)

    return (
        <div>
            <h1>Mobile Catalogue</h1>
            <div>
                {phone.map((item: any) => (
                    <div key={item.id}>
                        <h2>{item.name}</h2>
                        <p>{item.description}</p>
                        <img src={item.image} alt={item.name} />
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Dummy
